import React from "react";


const Resume = () => {



    return (
        <div className="resume-wrapper">
            <div className="Resume">
                <a target="_blank" href="https://drive.google.com/file/d/1Rk8PHvxrtdeQEmETz7ERa1Mc3xChLtm_/view">
                    <button>
                        View/download resume here
                </button>
                </a>
            </div>
        </div>
    )
}

export default Resume;
